import React from "react";

const ItemDetail =({detalles})=>{
    const imagen = detalles.images
    return(
        
        <>
        <h1>Aqui esto es {detalles.id} y {imagen}</h1>
        <img src={require=(imagen)} alt="" />
  
        
        </>
    )

}

export default ItemDetail
